import React from 'react'
import {Carrossel} from './carrossel.js'

export default function Slide() {
  
  return (
      <>
        {Carrossel.map((slide, index)=> {
          return(
            <img src={slide.image} alt="Notícia 1" title='Notícia 1'/>
          )
        })}
      </>
  );
}
